import React from 'react';
import Grid from './Grid';
import './Data.css';
import Button from 'react-bootstrap/Button';

function Data() {
    return (
        <div className='data-view-container'>
            <div className='grid-and-button-container'>
                <Grid className='grid' />
                <Button className='export-button' variant='outline-primary'>
                    Export Data
                </Button>
            </div>
        </div>
    );
}

export default Data;
